  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115606 includes chemical,
  discrete sample, physical and profile data collected from SHOYO in the North Pacific
  Ocean and Philippine Sea from 1994-11-01 to 1994-11-14 and retrieved during cruise
  PACIFICA_492S19941101 and WOCE P02W. These data include DISSOLVED OXYGEN, HYDROSTATIC
  PRESSURE, Potential temperature (theta), SALINITY and WATER TEMPERATURE. The instruments
  used to collect these data include CTD and bottle. These data were collected by
  Yoshiyuki Iwanaga of Japan Oceanographic Data Center as part of the PACIFICA_492S19941101
  data set.nnPACIFICA (PACIFic ocean Interior CArbon) was an international collaborative
  project for the data synthesis of ocean interior carbon and its related parameters
  in the Pacific Ocean. The North Pacific Marine Science Organization (PICES), Section
  of Carbon and Climate (S-CC) supported the project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
